INSERT INTO property (id, lat, lon, name, title, price, m2, description, total_bed_rooms, total_baths, type_id, city_id, total_meet_booking, total_visits) VALUES (26, '40.123456', '-3.987654', 'Apartamento moderno cerca del mar', 'Espectacular apartamento con vistas al océano', 1800.0, 100.0, 'Este moderno apartamento se encuentra estratégicamente ubicado cerca del mar y ofrece impresionantes vistas al océano. Cuenta con amplias habitaciones, una cocina totalmente equipada y una decoración elegante. Ideal para aquellos que buscan una estancia de lujo y comodidad.', 2, 3, 2, 12, 0, 0);
INSERT INTO property (id, lat, lon, name, title, price, m2, description, total_bed_rooms, total_baths, type_id, city_id, total_meet_booking, total_visits) VALUES (27, '41.987654', '2.123456', 'Casa de campo con piscina privada', 'Retiro tranquilo en plena naturaleza', 2500.0, 200.0, 'Esta hermosa casa de campo ofrece un retiro tranquilo en plena naturaleza. Rodeada de exuberantes paisajes, cuenta con una amplia piscina privada, jardines cuidados y una decoración rústica y acogedora. Ideal para aquellos que desean escapar del bullicio de la ciudad y disfrutar de la paz y la tranquilidad del campo.', 4, 4, 1, 25, 0, 0);
INSERT INTO property (id, lat, lon, name, title, price, m2, description, total_bed_rooms, total_baths, type_id, city_id, total_meet_booking, total_visits) VALUES (28, '39.654321', '-0.789012', 'Piso elegante en zona exclusiva', 'Estilo y sofisticación en cada detalle', 2200.0, 120.0, 'Este elegante piso ubicado en una zona exclusiva destaca por su estilo y sofisticación en cada detalle. Con amplios espacios, acabados de alta calidad y una distribución impecable, ofrece el máximo confort y lujo. Ideal para aquellos que valoran el diseño y la elegancia en su hogar.', 3, 2, 3, 8, 0, 0);
INSERT INTO property (id, lat, lon, name, title, price, m2, description, total_bed_rooms, total_baths, type_id, city_id, total_meet_booking, total_visits) VALUES (30, '43.123456', '-2.987654', 'Apartamento con terraza en el centro histórico', 'Encanto y comodidad en cada rincón', 1600.0, 90.0, 'Este encantador apartamento se encuentra en el corazón del centro histórico y ofrece una combinación perfecta de encanto y comodidad. Con una hermosa terraza, vistas panorámicas, espacios luminosos y una decoración acogedora, te sentirás como en casa desde el primer momento. Ideal para aquellos que buscan experimentar la auténtica vida en la ciudad.', 2, 1, 2, 35, 0, 0);
INSERT INTO property (id, lat, lon, name, title, price, m2, description, total_bed_rooms, total_baths, type_id, city_id, total_meet_booking, total_visits) VALUES (31, '40.987654', '-3.123456', 'Casa rural con encanto en las montañas', 'Relajación y conexión con la naturaleza', 2000.0, 150.0, 'Esta encantadora casa rural te brinda la oportunidad de disfrutar de la relajación y la conexión con la naturaleza. Situada en un entorno montañoso, ofrece impresionantes vistas panorámicas, un jardín exuberante y acogedores espacios interiores. Ideal para aquellos que desean escapar del estrés diario y disfrutar de la tranquilidad del entorno natural.', 4, 3, 1, 40, 0, 0);
INSERT INTO property (id, lat, lon, name, title, price, m2, description, total_bed_rooms, total_baths, type_id, city_id, total_meet_booking, total_visits) VALUES (32, '41.654321', '2.789012', 'Piso amplio en zona residencial', 'Comodidad y funcionalidad en un solo lugar', 1800.0, 110.0, 'Este amplio piso ubicado en una zona residencial te brinda la comodidad y funcionalidad que necesitas en tu vida diaria. Con espacios bien distribuidos, abundante luz natural y acabados de calidad, disfrutarás de un estilo de vida práctico y confortable. Ideal para aquellos que valoran la calidad de vida en un entorno tranquilo y familiar.', 3, 2, 3, 15, 0, 0);
INSERT INTO property (id, lat, lon, name, title, price, m2, description, total_bed_rooms, total_baths, type_id, city_id, total_meet_booking, total_visits) VALUES (33, '37.987654', '-6.123456', 'Chalet de lujo en urbanización exclusiva', 'Vive el lujo en todo su esplendor', 4000.0, 350.0, 'Este impresionante chalet de lujo te brinda la oportunidad de vivir el lujo en todo su esplendor. Con amplias habitaciones, una piscina privada, jardines cuidados y una arquitectura imponente, disfrutarás de un estilo de vida exclusivo y sofisticado. Cada detalle ha sido cuidadosamente diseñado para brindarte una experiencia única y memorable.', 4, 3, 1, 50, 0, 0);
INSERT INTO property (id, lat, lon, name, title, price, m2, description, total_bed_rooms, total_baths, type_id, city_id, total_meet_booking, total_visits) VALUES (34, '43.654321', '-2.789012', 'Apartamento en primera línea de playa', 'Disfruta de vistas panorámicas al mar', 2500.0, 120.0, 'Este encantador apartamento está ubicado en primera línea de playa, ofreciendo vistas panorámicas al mar desde cada rincón. Con una decoración moderna y acogedora, te brinda la oportunidad de disfrutar del sonido de las olas y los hermosos atardeceres desde la comodidad de tu hogar. Ideal para aquellos que buscan un estilo de vida relajado y playero.', 2, 1, 2, 20, 0, 0);
